import React, { useState } from 'react';
import { StyleSheet, View, Text, Image } from 'react-native';
import {useDispatch, useSelector} from "react-redux";
import { MediumAppText } from '../styles/text'
import Divider from '../components/Divider'
import Slider from '@react-native-community/slider';

function Feeling () {

  const [sliderValue, setSliderValue] = useState(false)
  const [sliderCompletionValue, setSliderCompletionValue] = useState(false)

  return (
    <View style={styles.container}>
      <MediumAppText style={{fontSize: 16}}>How are you feeling today?</MediumAppText>
      <Slider
        style={{width: 200, height: 40}}
        minimumValue={0}
        step={1}
        maximumValue={10}
        onValueChange={value => setSliderValue(value)}
        onSlidingComplete={value => setSliderCompletionValue(value)}
        minimumTrackTintColor="blue"
        maximumTrackTintColor="#000000"
      />
      <Text>{sliderValue}</Text>
      <Text>{sliderCompletionValue}</Text>
      <Divider/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
  },
});



export default Feeling;
